    // }

    // function getG1() public  view returns(set1[] memory) {
    //     return group1;
    // }


    // struct set2 {
    //     uint[] g;
    //     string[] h;
    //     bytes1[4] i;
    //     /*uint[4] j;
    //     address[4] k;
    //     string[4] l;*/
    // }

    // set2 s2;
    // set2[] group2;

    // function getS2() public view returns(set2 memory) {
    //     return s2;
    // }

    // function pushG2() public {
